import React from 'react';
import {Link} from "react-router-dom";

function AboutPage(props) {
    return (
        <div className={'text-3xl'}>
            <Link to={'/about'}>About</Link>
            <div>About Page</div>
        </div>
    );
}

export default AboutPage;
